function base64save( $document, $dir='', $ext='zip' ) {
    $randName = uniqid();
    $source = fopen("data:application\/$ext;base64,".$document, 'r');
    $newName = $dir.$randName.".$ext";
    $destination = fopen($newName, 'w');
    stream_copy_to_stream($source, $destination);
    return $newName;
}

function getZipFiles($savedFile) {
    $zip = new ZipArchive;
    if ($zip->open ($savedFile) !== TRUE)
        die ("Error: $zip\n");
    $count = $zip->numFiles;
    $arr = [];
    for ($i = 0; $i < $count; $i++)
    {
        $stat = $zip->statIndex ($i);
        $arr[]=$stat['name'];
    }
    $zip->close ();
    return $arr;
}

function detectHeader($name) {
    $sp = explode(".", $name);
    $ext = $sp[count($sp)-1];
    switch (strtolower($ext)) {
        case 'jpg':
            return 'image/jpeg';
        case 'gif':
            return 'image/gif';
        case 'pdf':
            return 'application/pdf';
        default: '';
    }
}
function putZipFile($savedZip, $name ) {
    $header = detectHeader($name);
    header("Content-Type: $header");
    echo file_get_contents("zip://$savedZip#$name");
    unlink($savedZip);
}


